import { withStyles } from "@material-ui/core/styles";

// import { useStyles } from "@andywer/style-hook"
export default withStyles(() => ({
  rot: {
    maxWidth: '100%'
  },
  media: {
    height: 0,
    paddingTop: '56.25%'
  },
  cardContent: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  cartActions: {
    display: 'flex',
    justifyContent: 'flex-end',
  },
}));
